function formatCode(code) {
    // escape html
    code = code.replace(/</g, '&lt;').replace(/>/g, '&gt;');

    // remove =""
    code = code.replace(/=""/g, '');

    // remove all space
    code = code.trim();

    // remove spaces at the beginning of each line
    let lines = code.split('\n');
    let minSpace = 999;
    lines.forEach((line, index) => {
        if (index === 0) return;
        if (line.length > 0) {
            let space = 0;
            while (line[space] === ' ') {
                space++;
            }
            if (space < minSpace) {
                minSpace = space;
            }
        }
    });
    lines.forEach((line, index) => {
        if (index === 0) return;
        lines[index] = line.slice(minSpace);
    });
    code = lines.join('\n');

    return code;
}

